Verenigde Staten
Komedie / Romantiek
110 minuten

goed

met Adam Sandler, Kevin James en Jessica Biel

Chuck Levine en Larry Valentine zijn de trots van hun brandweerkorps: je kunt altijd op hen aan en ze staan altijd aan elkaars 
zijde. Chuck echter is een verstokt vrijgezel, terwijl Larry dol is op zijn gezin. Ooit heeft Larry Chuck's leven gered zodat 
hij hem wat schuldig is en de tijd is gekomen dat Larry iets terugvraagt: ze moeten zich als formaliteit registreren als 
samenwonende heren, zodat Larry's kinderen aanspraak maken op een levensverzekering-uitkering. Helaas dat toevallig een 
vervelende bureaucraat uitgerekend deze zaak besluit te onderzoeken en de heren gedwongen worden daadwerkelijk samen te wonen...
